export const DVOTSurekhBShip="";

// Font loading function
export const loadDvoSBShipFont = (doc) => {
    if (!doc) return;
    
    doc.addFileToVFS("DVOTSurekh_B_Ship.ttf", DVOTSurekhBShip);
    doc.addFont("DVOTSurekh_B_Ship.ttf", "DVOTSurekh_B_Ship", "normal");
};

// Improved function to handle Marathi text correctly
export const reverseDevanagariText = (text) => {
    if (!text) return '';
    
    // Handle numbers and special characters
    const splitText = text.split(/([०-९0-9\s!@#$%^&*(),.?":{}|<>])/);
    
    return splitText
        .map(part => {
            // Don't reverse numbers, spaces, and special characters
            if (/[०-९0-9\s!@#$%^&*(),.?":{}|<>]/.test(part)) {
                return part;
            }
            // Reverse only Devanagari text
            return part.split('').reverse().join('');
        })
        .join('');
};




export const reverseDevanagariIfContainsViOrLi = (text) => {
    if (!text) return "";
    return text
    .replace(/श्चि/g, "िश्च") // compound first
    .replace(/स्थि/g, "िस्थ") // newly added
    .replace(/र्थि/g, "िर्थ") // newly added
      .replace(/वि/g, "िव")  // "वि" → "िव"
      .replace(/लि/g, "िल")  // "लि" → "िल"
      .replace(/बि/g, "िब") // "बि" → "िब"
      .replace(/शि/g, "िश") // "शि" → "िश"
      .replace(/रि/g, "िर")               // 
      .replace(/\bनि(?=[क-ह])/g, "िन") // ✅ smart safe
      .replace(/नि/g, "िन")
      .replace(/मि/g, "िम") // newly added
      .replace(/णि/g, "िण")
      .replace(/धि/g, "िध")    // newly added
      .replace(/दि/g, "िद")    // newly added
      .replace(/हि/g, "िह") // newly added
      .replace(/टि/g, "िट")
      .replace(/पि/g, "िप")
      .replace(/\bपि(?=[क-ह])/g, "िप")
    .replace(/मि/g, "िम")
      .replace(/भि/g, "िभ"); // ✅ newly added
  };



  export const fixPashchim = (text) => {
    const ZWJ = "\u200D";
    return text.replace(/पिश्च/g, "ि" + ZWJ + "पश्च");
  };